import React, { Component } from 'react';
import images from './images';
import './SmallCardPanel.css';

class SmallCardPanel extends Component {
	static defaultProps = {
		cards: [
			{
				name: 'Card 1',
				src: `./images/care/${[]}`,
				id: 1
			},
			{
				name: 'Card 2',
				src: `./images/care/${[]}`,
				id: 2
			}
		]
	};

	render () {
		return (
			<div>
				<h1 className="display-3 text-center">Small Card Panel</h1>
				<div className="container">
					<div className="row">
						{this.props.cards.map((c) => (
							<div className="Card col-2 text-center" key={c.id}>
								<img src={c.src} alt={c.name} />
							</div>
						))}
					</div>
				</div>
			</div>
		);
	}
}

export default SmallCardPanel;
